import React from "react";
import "./Frame3239.css";

function Frame3239(props) {
  const { farmers, text264, address } = props;

  return (
    <div className="frame-3239">
      <div className="frame-3241">
        <div className="farmers2">{farmers}</div>
        <div className="text-264 valign-text-middle">{text264}</div>
      </div>
      <div className="address4 valign-text-middle inter-medium-quarter-spanish-white-16px">{address}</div>
    </div>
  );
}

export default Frame3239;
